import React, { useEffect, useState } from "react";
import { BrowserRouter as Router, Routes, Route, Navigate } from "react-router-dom";
import { getAuth, onAuthStateChanged, setPersistence, browserLocalPersistence } from "firebase/auth"; // Firebase import

import LandingPage from "./LandingPage";
import LoginForm from "./LoginForm";
import Dashboard from "./Dashboard";
import BusinessInfoSystems from "./subjects/BusinessInfoSystems/BusinessInfoSystems";
import Grid from "./subjects/Grid/Grid";
import Urs from "./subjects/Urs/Urs";
import Multimedija from "./subjects/Multimedija/Multimedija";
import Medicinski from "./subjects/Medicinski/Medicinski";
import Paralelno from "./subjects/Paralelno/Paralelno";
import QRCodeScanner from "./scanner/QRCodeScanner";

// Postavljanje Firebase persistence na 'local' kako bi podaci bili pohranjeni trajno
const authInstance = getAuth();
setPersistence(authInstance, browserLocalPersistence);  // Osiguranje da podatci ostanu pohranjeni u localStorage

const App = () => {
  const [user, setUser] = useState(null);

  // Praćenje promjena u stanju prijavljenog korisnika
  useEffect(() => {
    // Prvo provjerimo je li korisnik pohranjen u localStorage
    const storedUser = localStorage.getItem('user');  // Dohvati korisnika iz localStorage
    console.log('Dohvaćeni korisnik iz localStorage:', storedUser); // Provjera podataka

    if (storedUser) {
      setUser(JSON.parse(storedUser));  // Ako postoji korisnik u localStorage, postavi ga u state
    }

    // Postavljamo Firebase listener za promjenu stanja korisnika
    const unsubscribe = onAuthStateChanged(authInstance, (currentUser) => {
      console.log('Trenutni korisnik:', currentUser);  // Provjera trenutnog korisnika
      if (currentUser) {
        setUser(currentUser);  // Ako je korisnik prijavljen, postavi korisnika u state
        localStorage.setItem('user', JSON.stringify(currentUser));  // Pohrani korisnika u localStorage
      } else {
        setUser(null);  // Ako nije prijavljen, postavi korisnika na null
        localStorage.removeItem('user');  // Ukloni korisnika iz localStorage
      }
    });

    return () => unsubscribe();  // Čisti pretplatu kad komponenta bude unmountana
  }, []);

  // Ovdje dodajemo loading stanje dok čekamo Firebase da odgovori
  if (user === null) {
    return <div>Učitavanje...</div>;
  }

  return (
    <Router>
      <Routes>
        <Route path="/" element={<LandingPage />} />
        <Route path="/login" element={<LoginForm />} />
        <Route 
          path="/dashboard" 
          element={user ? <Dashboard /> : <Navigate to="/login" />} 
        />
        <Route
          path="/business-info-systems"
          element={user ? <BusinessInfoSystems /> : <Navigate to="/login" />}
        />
        <Route
          path="/grid-computer-systems"
          element={user ? <Grid /> : <Navigate to="/login" />}
        />
        <Route path="/urs" element={user ? <Urs /> : <Navigate to="/login" />} />
        <Route
          path="/multimedija"
          element={user ? <Multimedija /> : <Navigate to="/login" />}
        />
        <Route
          path="/medicinski"
          element={user ? <Medicinski /> : <Navigate to="/login" />}
        />
        <Route
          path="/paralelno"
          element={user ? <Paralelno /> : <Navigate to="/login" />}
        />
        <Route
          path="/scanner"
          element={user ? <QRCodeScanner /> : <Navigate to="/login" />}
        />
      </Routes>
    </Router>
  );
};

export default App;
